import React from 'react';

const CenteredBox = () => {
  const boxStyle = {
    width: '300px',
    height: '200px',
    margin: 'auto',
    marginTop: '50px',
    border: '1px solid #ccc',
    borderRadius: '5px',
    textAlign: 'center',
    padding: '20px',
    boxSizing: 'border-box',
    overflow: 'hidden', // Prevent content from overflowing
    overflowY: 'auto', // Add vertical scrollbar if needed
  };

  return (
    <div style={boxStyle}>
      <h1>Your Content Goes Here</h1>
      <p>
        This is a centered box with margins around it. Your text content goes
        here. Make sure that it doesn't overflow outside the box.
      </p>
    </div>
  );
};

export default CenteredBox;
